import React, { Fragment } from "react";

import Item from "./Item";

const ItemsList = (props) => {
  const tmpObj = {
    name: "test",
    date: "TestDate",
  };

  return (
    <Fragment>
      {props.items.map((item) => {
        <Item obj={item} />;
      })}
    </Fragment>
  );
};

export default ItemsList;
